export const htmlToNode = htmlStr => {
  if (!htmlStr || typeof htmlStr !== "string") return;
  const tmpElmt = document.createElement("div");
  tmpElmt.innerHTML = htmlStr;
  return tmpElmt.childNodes[0];
};

